function SignUpEmployer() {
    return (
        <Fragment>
            <HelmetProvider>
        <Helmet>
          <title> Employer - Sign Up & Log In | Zom - IN </title>
        </Helmet>
      </HelmetProvider>
      <div id="signUpEmployer" className="signUpEmployer">
      <Col sm={11} md={9} className="mx-auto">
          <Row>
          <Col sm={12} md={6}>

          </Col> 
          </Row>
      </Col>
      </div>
        </Fragment>
    )
}

export default SignUpEmployer
